const parseAgeGroup = (ageGroupStr: string): { minAge: number; maxAge: number } => {
  if (!ageGroupStr || typeof ageGroupStr !== 'string') return { minAge: 0, maxAge: 120 };

  const ageGroup = ageGroupStr.trim();

  if (ageGroup.includes('רב גילאי')) return { minAge: 0, maxAge: 120 };
  if (ageGroup.includes('גיל שלישי') || ageGroup.includes('מעלה')) {
      const min = ageGroup.match(/\d+/);
      return { minAge: min ? parseInt(min[0], 10) : 66, maxAge: 120 };
  }
  
  const numbers = ageGroup.match(/\d+/g);
  
  if (numbers && numbers.length > 0) {
    if (numbers.length === 1) {
      return { minAge: parseInt(numbers[0], 10), maxAge: parseInt(numbers[0], 10) };
    }
    const ages = numbers.map(n => parseInt(n, 10));
    return { minAge: Math.min(...ages), maxAge: Math.max(...ages) };
  }
  
  return { minAge: 0, maxAge: 120 };
};


