export const activities: Activity[] = rawData.map((activity, index) => {
  const { minAge, maxAge } = parseAgeGroup(activity.ageGroup);
  return {
    ...activity,
    id: index,
    price: isNaN(activity.price as number) ? null : Number(activity.price),
    minAge,
    maxAge,
  };
});

export const categories = [...new Set(activities.map(a => a.category))];
export const locations = [...new Set(activities.map(a => a.communityCenter))];
